import React from "react";
import { Card, CardContent, Typography, Box } from "@mui/material";
import TrainIcon from "@mui/icons-material/Train";
import BuildCircleIcon from "@mui/icons-material/BuildCircle";
import TimerIcon from "@mui/icons-material/Timer";
import CheckCircleIcon from "@mui/icons-material/CheckCircle";

const icons = {
  train: <TrainIcon color="success" />,
  build: <BuildCircleIcon color="warning" />,
  timer: <TimerIcon color="warning" />,
  check_circle: <CheckCircleIcon color="success" />,
};

export default function StatCard({ label, value, sublabel, icon }) {
  return (
    <Card
      elevation={0}
      sx={{
        minHeight: 120,
        display: "flex",
        alignItems: "center",
        borderRadius: 2,
        border: '1px solid #607D8B33',
        boxShadow: '0 10px 24px rgba(48,213,200,0.14)'
      }}
    >
      <CardContent sx={{ flexGrow: 1 }}>
        <Typography sx={{ color: '#607D8B' }} variant="subtitle1">
          {label}
        </Typography>
        <Typography variant="h5" fontWeight={800} sx={{ color: '#37474F' }}>
          {value}
        </Typography>
        {sublabel && (
          <Typography sx={{ color: '#607D8B' }} variant="body2">
            {sublabel}
          </Typography>
        )}
      </CardContent>
      <Box sx={{ pr: 2, fontSize: 38 }}>
        {icons[icon]}
      </Box>
    </Card>
  );
}
